import React from "react";
import styled from 'styled-components';
const Wrapper = styled.div`
  width: 250px;
  height: 501px;
  position: absolute;
  box-shadow: inherit;
  right: 80px;
  top: -105px;
  background-image: url("https://mobilestream.ru//landing/images/mobileid/iphone-transparent.png");
  background-size: contain;
  div {
    overflow: hidden;
    display: flex;
    height: 382px;
    width: 218px;
    top: 68px;
    left: 16px;

  img {
    position: relative;    
  }
  }
`


export const Slider: React.FC<ISlider> = props => (
    <Wrapper>
        <div>
            {props.imgArray.map(img => <img src={img} alt="slide" />)}
        </div>
    </Wrapper>
);

interface ISlider {
    imgArray: string[];
}
